    std::array<Scalar, 10> output_norms = {3.369401680e-02, 3.100321106e-05, 1.829187152e-07, 3.436954471e-07, 5.064507274e-08, 1.635208197e-07, 6.157626974e-08, 2.304848600e-07, 1.156929790e-10, 8.231267495e-12};

